import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <header>
      <div className="container">
        <div className="row">
        <div className="col-4"><img className="facebookLogo" src="https://i.ya-webdesign.com/images/facebook-white-logo-png-3.png" alt="Facebook Logo"/></div>
        <div class="col-8">col-4</div>
        </div>
      </div>

      </header>

    </div>
  );
}

export default App;
